import './App.css';
import {BrowserRouter,Routes,Route,Link} from "react-router-dom";

function App() {
  return (
   <div>
      <div>
        <Link to={'/'}>Home</Link> | 
        <Link to={'/login'}>Login</Link> | 
        <Link to={'/register'}>Register</Link>
      </div>
      <Routes>
          <Route exact path={'/register'} component={Register} />
          <Route exact path={'/login'} component={Login} />
      </Routes>
   </div>
  );
}

export default App;
